#include <stdio.h>
#include <math.h>


int main(){
	
	char num[1001] = ""; 
	int stack[5];
	int i,j,k;
	int cLargest = 0;
	
	stack[0] = 7;
	stack[1] = 3;
	stack[2] = 1;
	stack[3] = 6;
	stack[4] = 7;
	
	for(i=4;i<1000;i++){
		stack[i%5] = num[i]-'0';
		k = 1;
		
		for(j=0;j<5;j++){
			k = k*stack[j];
			//printf("%d\n",k);

		}
		
		if(k > cLargest){
			cLargest = k;
		}
		
	}
	printf("%d",cLargest);
	
	

}